import{_ as A}from"./plugin-vue_export-helper-DlAUqK2U.js";import{o as e,c as v,f as z}from"./app-C3_r1bOQ.js";const k={},Q=z('<h2 id="什么是mvvm" tabindex="-1"><a class="header-anchor" href="#什么是mvvm"><span>什么是MVVM</span></a></h2><p>MVVM（Model-View-ViewModel）是一种软件设计模式，是一种简化用户界面的事件驱动编程方式。</p><p>MVVM源自于经典的MVC（Model-View-Controller）模式。MVVM的核心是ViewModel层，负责转换Model中的数据对象来让数据变得更容易管理和使用。其作用如下：</p><p>该层向上与视图层进行双向数据绑定</p><p>向下与Model层通过接口请求进行数据交互</p><img src="data:image/png;base64,"><p>MVVM已经相当成熟了，主要运用但不仅仅在网络应用程序开发中。</p><h2 id="为什么使用mvvm" tabindex="-1"><a class="header-anchor" href="#为什么使用mvvm"><span>为什么使用MVVM</span></a></h2><p>MVVM模式和MVC模式一样，主要目的是分离视图（View）和模型（Model），有几大好处</p><p><code>低耦合</code>：视图（View）可以独立于Model变化和修改，一个 <code>ViewModel</code> 可以绑定到不同的View上，当View变化的时候Model可以不变，当Model变化的时候View也可以不变。</p><p><code>可复用</code>：你可以把一些视图逻辑放在一个 <code>ViewModel</code> 里面，让很多View重用这段视图逻辑。</p><p><code>独立开发</code>：开发人员可以专注于业务逻辑和数据的开发（ <code>ViewModel</code> ），设计人员可以专注于页面设计。</p><p><code>可测试</code>：界面素来是比较难以测试的，而现在测试可以针对 <code>ViewModel</code> 来写。</p><img src="data:image/png;base64,">',14),d=[Q];function P(t,f){return e(),v("div",null,d)}const B=A(k,[["render",P],["__file","MVVM.html.vue"]]);export{B as default};
